import {CREATE_ROOM} from "../actions";

const initialState = {
    room: 0,
    roomA: 1
}

const testReducer = (state = initialState, action) => {
    switch (action.type) {
        case CREATE_ROOM:
            state.room = state.room + 1;
            return state.room;

        default:
            return state;
    }
}

export default testReducer;
